script: |
  super -f text -I q10231.spq | sort > q10231.out

inputs:
  - name: q10231.spq
    data: |
      SELECT + 6 * + COUNT ( * ) + 82 * + 11 AS col2 FROM tab0 (FORMAT parquet) WHERE col0 - 42 BETWEEN + 22 AND - 35 + + col0 * col1;
  - name: tab0

outputs:
  - name: q10231.out
    data: |
      914
